import React from 'react';
import paymentSuccessGif from '../'; // Update the path accordingly

const PaymentSuccess = () => {
  return (
    <div className="container mt-5 text-center">
      <img src="https://cdn.iconscout.com/icon/premium/png-512-thumb/payment-done-4153286-3446841.png?f=webp&w=256" width="480" height="360"   allowFullScreen></img>
      <h2 className="mt-3">Payment Successful!</h2>
      <p>Your payment has been processed successfully.</p>
    </div>
  );
};

export default PaymentSuccess;
